package org.santihs.poointerfaces.printing.model;public class Report extends PaperSheet implements Printable {    private String author;    private String reviewer;    public Report(String contents, String author, String reviewer) {        super(contents);        this.author = author;        this.reviewer = reviewer;    }    @Override    public String print() {        return "Report written by " + this.author + ", reviewed by " + this.reviewer + ", Content: " + super.contents;    }}